 ('110', '19', '7', '1', 'en_us', '25', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"About Our Church\",\"slug\":\"about-our-church\",\"postDate\":1497464640,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"15\",\"fields\":{\"15\":[\"70\"],\"13\":{\"47\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"textField\":\"<p>We are a congregation of over four hundred members in the beautiful Sulphur Springs community of Washington County, Tennessee. We are a congregation with a unique history and an exciting future. We are United Methodists, but most importantly, we are disciples of Jesus Christ. We are people just like you.<\\/p>\"}}},\"35\":\"\",\"29\":\"\"}}', '2017-07-27 17:07:34', '2017-07-27 17:07:34', '9e2e6ed6-948c-4393-a6b4-05dcb8952f9a'),
