 ('112', '37', '7', '1', 'en_us', '6', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Contact Us\",\"slug\":\"contact-us\",\"postDate\":1499796000,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"18\",\"fields\":{\"15\":\"\",\"13\":{\"123\":{\"type\":\"form\",\"enabled\":\"1\",\"fields\":{\"selectFormType\":\"contactUs\",\"mailTo\":\"cowens@reachnative.com\"}}},\"35\":\"\",\"29\":\"\"}}', '2017-07-27 17:14:10', '2017-07-27 17:14:10', 'ef0d722f-c0eb-47f0-9621-d04935c95c4e'),
 ('113', '31', '7', '1', 'en_us', '2', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Worship\",\"slug\":\"worship\",\"postDate\":1499443020,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"16\",\"fields\":{\"15\":\"\",\"13\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"textField\":\"<p><b>Tradition & Innovation<\\/b><br>People have gathered in this place to worship God for the better part of two centuries, and though times have changed since people gathered in open fields and under brush arbors for the first camp meetings held here, our reverence in worship has remained constant throughout the years.<br><br>We gather for two worship services each Sunday morning. The day begins with a 9:00 AM contemporary worship service in our community ministry center, complete with multimedia features and praise band. At 11:00 AM, we gather together to worship God in a more traditional way.<br><br>About two hundred years ago, people worshiped God in the fields surrounding our church in the earliest camp meetings here, and that was an innovative, contemporary way of worship then. We are grateful that we have been able to maintain the traditions that our ancestors in the faith began here, and we pray that God will continue to lead us in new directions.<br><br>Come worship with us soon!<\\/p>\"}}},\"35\":\"\",\"29\":\"\"}}', '2017-07-27 17:14:40', '2017-07-27 17:14:40', '4452a886-5907-408c-9289-5a16298084f9'),
