 ('124', '28', '7', '1', 'en_us', '2', '', '{\"typeId\":\"7\",\"authorId\":\"1\",\"title\":\"Children\",\"slug\":\"children\",\"postDate\":1499442960,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"16\",\"fields\":{\"15\":[\"138\"],\"13\":{\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"fields\":{\"textField\":\"<p><b>\\\"Let the little children come to me, and do not hinder them, for to such belongs the kingdom of God.\\\"&nbsp;We believe it!<\\/b><br><br><br>We work constantly to find new ways to make the love of Jesus Christ real to the children of our community!&nbsp;<br><br><b>Nursery care&nbsp;<\\/b>is offered for young children for almost every church event. You can rest assured that there will always be a capable, caring adult ready to care for your child during any of our worship services. If you have questions about the availability of nursery care at any other event, please contact us.<br><br><b>Children\'s church&nbsp;<\\/b>is a special time of worship for children between three and eight years old. With the help of loving adults, the children learn the stories of the Bible and begin to develop their own worship habits.<br><br><b>Sunday School<\\/b>&nbsp;classes welcome children ages 2 and up. &nbsp;Click on link to the left for ages and location of all classes for children and youth.<br><br>On Sunday evenings, we have&nbsp;<b>Children\'s Choir<\\/b>&nbsp;and&nbsp;<b>Youth Choir<\\/b>practice. &nbsp;Throughout the year, we have fun Sunday evening events, like the annual Easter Egg hunt and \\\"Trunks of Treats,\\\" our annual celebration of Halloween.<br><br>Throughout the week, Sulphur Springs Community&nbsp;<b>Childcare Center&nbsp;<\\/b>provides daycare for children between ages three months and five years. We offer a loving, nurturing environment for children to develop their social skills together.<br><br>If you have questions about any of our children\'s ministries, please <a href=\\\"http:\\/\\/dev.sulphurspringsumc.com\\/contact\\/contact-us#entry:37\\\">contact us<\\/a>.<\\/p>\"}}},\"35\":\"\",\"29\":\"\"}}', '2017-07-28 17:56:55', '2017-07-28 17:56:55', '7c80ece7-3938-4d18-a770-7ad4f18fc186'),
