INSERT INTO `craft_matrixcontent_insidepageelements` (`id`, `elementId`, `locale`, `field_header_bodyHeader`, `field_text_textField`, `field_video_bodyVideoPosition`, `field_form_selectFormType`, `field_form_mailTo`, `field_map_mapButton`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('3', '47', 'en_us', NULL, '<p>We are a congregation of over four hundred members in the beautiful Sulphur Springs community of Washington County, Tennessee. We are a congregation with a unique history and an exciting future. We are United Methodists, but most importantly, we are disciples of Jesus Christ. We are people just like you.</p>', NULL, NULL, NULL, '0', '2017-07-21 19:33:02', '2017-07-27 17:07:34', '8a947a25-50b7-4cf9-8ff8-da0a11cc324b'),
 ('5', '59', 'en_us', NULL, '<p>These are not the people who \"do\" ministry in our church — they are the people who help to facilitate, to enable, to encourage the entire congregation as it engages in ministry. We are here to serve you in the name of Jesus Christ! We invite you to get to know us, to contact us, and to join us in serving Christ.</p>', NULL, NULL, NULL, '0', '2017-07-24 16:42:35', '2017-07-24 20:42:18', 'a2b60143-e5f6-45f3-90f5-dd20ca4e113e'),
 ('6', '83', 'en_us', NULL, '<p>Giving online is very safe and easy to use. Selecting the button below will redirect you to Tithe.ly to submit your donation.</p>\n<p><br /></p>', NULL, NULL, NULL, '0', '2017-07-26 16:18:25', '2017-07-26 17:39:09', 'd59f7b36-1e0b-47e3-8c26-fb2379f2b6f3'),
 ('11', '121', 'en_us', NULL, '<p>Submit your requests here. (A more thorough paragraph could be added here.)</p>', NULL, NULL, NULL, '0', '2017-07-27 14:10:37', '2017-07-27 15:00:56', '378cb7e0-e462-4bdc-842d-0721f9da7e3d'),
 ('12', '122', 'en_us', NULL, NULL, NULL, 'prayerRequest', 'cowens@reachnative.com', '0', '2017-07-27 14:32:48', '2017-07-27 15:00:56', '58a28a64-c2de-43fc-8198-b41f985f4d76'),
 ('13', '123', 'en_us', NULL, NULL, NULL, 'contactUs', 'owenscoreymac@icloud.com', '0', '2017-07-27 15:03:29', '2017-08-04 16:26:09', '352606cf-4c86-4779-ae7f-02c9e28c8017'),
 ('14', '124', 'en_us', NULL, '<p><strong>Tradition &amp; Innovation</strong><br />People have gathered in this place to worship God for the better part of two centuries, and though times have changed since people gathered in open fields and under brush arbors for the first camp meetings held here, our reverence in worship has remained constant throughout the years.</p>\n<p><br />We gather for two worship services each Sunday morning. The day begins with a 9:00 AM contemporary worship service in our community ministry center, complete with multimedia features and praise band. At 11:00 AM, we gather together to worship God in a more traditional way.<br /><br />About two hundred years ago, people worshiped God in the fields surrounding our church in the earliest camp meetings here, and that was an innovative, contemporary way of worship then. We are grateful that we have been able to maintain the traditions that our ancestors in the faith began here, and we pray that God will continue to lead us in new directions.<br /><br />Come worship with us soon!</p>', NULL, NULL, NULL, '0', '2017-07-27 17:14:40', '2017-07-27 21:09:49', 'efc48eee-cbff-4122-a04f-43872eb8c4c5'),
 ('15', '139', 'en_us', NULL, '<p><b>\"Let the little children come to me, and do not hinder them, for to such belongs the kingdom of God.\" We believe it!</b><br /><br /><br />We work constantly to find new ways to make the love of Jesus Christ real to the children of our community! <br /><br /><b>Nursery care </b>is offered for young children for almost every church event. You can rest assured that there will always be a capable, caring adult ready to care for your child during any of our worship services. If you have questions about the availability of nursery care at any other event, please contact us.<br /><br /><b>Children\'s church </b>is a special time of worship for children between three and eight years old. With the help of loving adults, the children learn the stories of the Bible and begin to develop their own worship habits.<br /><br /><b>Sunday School</b> classes welcome children ages 2 and up.  Click on link to the left for ages and location of all classes for children and youth.<br /><br />On Sunday evenings, we have <b>Children\'s Choir</b> and <b>Youth Choir</b>practice.  Throughout the year, we have fun Sunday evening events, like the annual Easter Egg hunt and \"Trunks of Treats,\" our annual celebration of Halloween.<br /><br />Throughout the week, Sulphur Springs Community <b>Childcare Center </b>provides daycare for children between ages three months and five years. We offer a loving, nurturing environment for children to develop their social skills together.<br /><br />If you have questions about any of our children\'s ministries, please <a href=\"{entry:37:url}\">contact us</a>.</p>', NULL, NULL, NULL, '0', '2017-07-28 17:56:54', '2017-07-28 17:56:54', '91dafa00-d2f3-47ba-8730-f102ebe5edbe'),
 ('16', '141', 'en_us', NULL, '<p>This is just a test paragraph. Add content to fill this page with something that is informative.</p>', NULL, NULL, NULL, '0', '2017-08-01 02:42:38', '2017-08-01 02:42:38', '2ce8f8ef-4d99-4504-90d2-c55c017790a6'),
 ('17', '151', 'en_us', NULL, NULL, NULL, NULL, NULL, '1', '2017-08-04 15:49:20', '2017-08-04 16:26:09', '5b4c18d7-83ba-4b4f-87ac-38b7da9205af');



