 ('28', 'field', '15', 'en_us', ' children cover '),
 ('28', 'field', '13', 'en_us', ' let the little children come to me and do not hinder them for to such belongs the kingdom of god we believe it we work constantly to find new ways to make the love of jesus christ real to the children of our community nursery care is offered for young children for almost every church event you can rest assured that there will always be a capable caring adult ready to care for your child during any of our worship services if you have questions about the availability of nursery care at any other event please contact us children s church is a special time of worship for children between three and eight years old with the help of loving adults the children learn the stories of the bible and begin to develop their own worship habits sunday school classes welcome children ages 2 and up click on link to the left for ages and location of all classes for children and youth on sunday evenings we have children s choir and youth choirpractice throughout the year we have fun sunday evening events like the annual easter egg hunt and trunks of treats our annual celebration of halloween throughout the week sulphur springs community childcare center provides daycare for children between ages three months and five years we offer a loving nurturing environment for children to develop their social skills together if you have questions about any of our children s ministries please contact us '),
