 ('31', 'field', '13', 'en_us', ' tradition innovationpeople have gathered in this place to worship god for the better part of two centuries and though times have changed since people gathered in open fields and under brush arbors for the first camp meetings held here our reverence in worship has remained constant throughout the years we gather for two worship services each sunday morning the day begins with a 9 00 am contemporary worship service in our community ministry center complete with multimedia features and praise band at 11 00 am we gather together to worship god in a more traditional way about two hundred years ago people worshiped god in the fields surrounding our church in the earliest camp meetings here and that was an innovative contemporary way of worship then we are grateful that we have been able to maintain the traditions that our ancestors in the faith began here and we pray that god will continue to lead us in new directions come worship with us soon '),
